import React from 'react';
import Button from './Button';
const ControlPanel = () => {
    return (
        <div className = 'control'>
            <Button border = {true} text = 'create new user' bg = 'white' color= 'black' />
            <Button text = 'remove old book' bg = 'red' color= 'white' />
            <Button text = 'create new book' bg = 'green' color= 'white' />
        </div>
    )
}

export default ControlPanel
